import "./App.css";
import Nav from './Nav';
import { BrowserRouter, Routes, Route, Router } from 'react-router-dom';
import Header from "./Header";

function App(){
    return(
        <div className='App'>
         <Router>
          <Nav/>
           <switch>
            <Route path="/" exact Component={Header}/>
           </switch>
         </Router>
        </div>
    );
}
export default App;
